rules.rule:
@keyframes fadeOut { 
  0% { opacity: 1; }
  100% { visibility: hidden; opacity: 0; width: 0px; }
}

@keyframes traffic-spotlight-bg-animation { 
  0% { border: 2px solid rgb(143, 162, 255); background-color: rgba(143, 162, 255, 0.15); transition-timing-function: cubic-bezier(0, 0, 1, 1); }
  100% { transition-timing-function: cubic-bezier(0, 0, 1, 1); }
}

@keyframes spotlight-traffic-transient-animation { 
  0% { border: 2px solid rgb(143, 162, 255); background-color: rgba(143, 162, 255, 0.15); }
  100% { transition-timing-function: cubic-bezier(0, 0, 1, 1); }
}

@keyframes spotlight-traffic-semitran-animation { 
  0% { background-color: rgba(143, 162, 255, 0.15); }
  100% { border: 2px solid rgb(143, 162, 255); transition-timing-function: cubic-bezier(0, 0, 1, 1); }
}

@keyframes spotlight-card-animation { 
  0% { border: 2px solid var(--sd-card-spotlight-border,#8FA2FF); background-color: var(--sd-card-spotlight-background,#8FA2FF26); transition-timing-function: cubic-bezier(0, 0, 1, 1); }
  100% { transition-timing-function: cubic-bezier(0, 0, 1, 1); }
}

cs-sd-card.dense {
  grid-template-rows: auto 1fr minmax(4px, auto); margin-top: 1px;
  @media (prefers-color-scheme: dark) {
  :host(:hover) { box-shadow: none !important; }
}
}

@supports selector(:nth-child(1 of x)) {
  :host { outline: none; box-shadow: 0 0 0 calc(var(--stroke-width) * 1px) var(--card-stroke-color),
                0px 2px 4px rgba(0, 0, 0, 0.04); }
  :host(:hover) { box-shadow: 0 0 0 calc(var(--stroke-width) * 1px) var(--card-stroke-color),
                0px 4px 8px rgba(0, 0, 0, 0.14); }
  @media (prefers-color-scheme: dark) {
  :host(:hover) { box-shadow: 0 0 0 calc(var(--stroke-width) * 1px) var(--card-stroke-color),
                    0px 4px 8px rgba(0, 0, 0, 0.26); }
}
}

@media (prefers-color-scheme: dark) {
  .header-overlay, .footer-overlay { background: rgba(0, 0, 0, 0.54); }
  .gradient { background: linear-gradient(rgba(0, 0, 0, 0.54) 0%, rgba(0, 0, 0, 0) 22%, rgba(0, 0, 0, 0) 86%, rgba(0, 0, 0, 0.54) 100%); }
}
